    function _generateRandomValue(uint256 _min, uint256 _max) internal view returns (uint256) {
        return _min + (uint256(keccak256(abi.encodePacked(block.timestamp, block.prevrandao, msg.sender))) % (_max - _min + 1));
    }
    
